import React from 'react';

function Contact(){
    return(        
    <div className="_react_container">
        <div className="contact_top">
            <div className="container">
                <h1>Contact</h1>
            </div>
        </div>
        <div className="container">
            <div className="row"></div>
        </div>
    </div>
    );
}
export default Contact;
